return {
	["Before I forget - the reward for the previous task: {axe}, {sword}, {mace}, {bow}, {rod}, {wand} (exercise weapon)."] = "Zanim wyleci mi to z glowy - nagroda za poprzednie zadanie: {axe}, {sword}, {mace}, {bow}, {rod}, {wand} (exercise weapon) ",
	["Ehh... before I tell you what's next, we need to deal with the HF-P/X insurance agent. You probably know him - they call him Turdstin."] = "Ehh... zanim Ci powiem co i jak, musimy sie uporac z agentem ubezpieczeniowym HF-P/X. Pewnie go znasz - mowia na niego sebix.",
	["Turdstin lives in the slums, Mirko. His life professions include homelessness, MGTOW, collecting cans, and being an insurance agent."] = "Sebix mieszka w slumsach mirko. Jego zyciowe profesje to bezdomnosc, mgtow, zbieranie puszek i bycie agentem ubezpieczeniowym.",
	["Well, hes just the smartest person in the world. Okay, let's not waste any more time. After HF-P/X's death, a time-delayed mechanism was activated, which opened a portal to the past. Now immigrants are flooding in from everywhere. Go to the portal in Knurow and head to the Knurow of the past. Find someone there who will help you with the task of stopping the influx of immigrants."] = "No po prostu najmadrzejszy czlowiek na swiecie. Dobra, nie marnujmy juz wiecej czasu. Po smierci HF-P/X zostal aktywowany opozniony czasowo mechanizm, ktory otworzyl portal do przeszlosci. Teraz zewszad naplywaja do nas imigranci. Udaj sie do portalu w knurowie, i udaj sie do knurowa z przeszlosci. Znajdz tam kogos, kto pomoze Ci z zadaniem zatrzymania naplywu imignatow. ",
	["I told you to use the portal in Knurow, although I don't remember exactly where it was located. Something tells me it was somewhere along the shore..."] = "Powiedzialem, abys skorzystal z portalu z Knurowie, chociaz nie pamietam, gdzie dokladnie sie znajdowal. Cos mi swita, ze to bylo gdzies nad brzegiem...",
	["So, it's Rat Bum. Hmm, but in the memes, it said that Rat Bum can't do anything. I know his origin. I would like to tell you where to find him, but currently, he is protected by a narrative armor. So, I suggest you go get some beer at Lewiatan now."] = "A wiec to Zul Szczurow. Hmm, a w memach bylo, ze Zul Szczurow nic nie moze. Znane jest mi pochodzenie Zula Szczurow. Chcialbym moc Ci powiedziec gdzie go znalezc, ale aktualnie broni go pancerz fabularny. Takze proponuje, abys teraz skoczyl po browca do Lewiatana.",
	["If you don't know where to find the nearest Lewiatan, ask Krzysztof Kolumb."] = "Jezeli nie wiesz, gdzie znalezc najblizszy Lewiatan, to zapytaj Krzysztofa Kolumba.",
	["But I wasn't talking about some monster, just that shop on the corner. During that time, I went to Walmart to get heineken because I couldn't wait for you. Now, back to the point. I recalled this old story: people from the northeast whisper about certain {slippers} that Rat Bum nibbled on. They say he tried to steal them from his Master, who, under the influence of slippers, descended into the abyss of corruption. The prophecy was funded by the Ministry of State Security of the People's Republic of China."] = "Ale mi nie chodzilo o jakiegos potwora, tylko o ten sklep na rogu. W tym czasie sam poszedlem do biedry po kustosza, bo nie moglem sie Ciebie doczekac. Teraz do rzeczy. Przypomnialy mi sie pewne dawne dzieje: ludzie z polnocnego wschodu szeptaja o pewnych {kapciach}, ktore nadgryzl Zul Szczurow. Mowia, ze probowal je wyrwac swojemu Panu, ktory pod ich wplywem stoczyl sie w otchlan przekupstwa. Proroctwo sfinansowano ze srodkow ministerstwa bezpieczenstwa panstwowego chinskiej republiki ludowej.",
	["Rumors have it that after the death of the aforementioned ruler, the slippers were buried with him. However, it is unknown where this burial place is. As I mentioned, all rumors about the origin of the slippers started with the inhabitants of the northern lands. I think it could be Rats collaborating with banshees. Search the corridors of their base. If you manage to find these slippers, based on the tooth pattern that bit the front part of the boot, we will find a matching profile on onlyfangs.com."] = "Pogloski mowia, ze po smierci rzeczonego wladcy kapcie zostaly pochowane wraz z nim. Jednak nie wiadomo gdzie znajduje sie to miejsce pochowku. Jak mowilem, wszelkie plotki o pochodzeniu kapci zaczely sie od mieszkacow krain polnocnych. Mysle, ze moglby to byc Szczury kolaborujace z banshee. Przeszukaj korytarze ich bazy. Jezeli uda Ci sie znalezc te kapcie, to na podstawie wzoru zebow, ktore ugryzly przednia czesc kapcia, znajdziemy odpowiadajacy im profil na onlyfangs.com ",
	["Look out in the eastern Kongo."] = "Rozejrzyj sie we wschodnich czesciach Kongo.",
	["Did you find anything about slippers owner?"] = "I jak, dowiedziales sie czegos wiecej o wlascicielu kapci?",
	["Rest is peace\n~Followers of The Frog Cult"] = "Spoczywaj w pokoju\nTwoi koledzy z kultu Oltarzu Weza",
	["Your eyes will open when mine have already closed itselves"] = "Tobia sie oczy otworzo jak mnie zamknol normalnie.",
	["Ruins are located in the northern part of Kongo"] = "Ruiny znajduja sie w polnocnej czesci Kongo.",
	["Try to search in the underground ruins in the Kongo. This place was inhabited long ago by medusas, hydras, and other writhing creatures, and it is overgrown with foul flora. An ideal place for an altar for serpentine gods."] = "Sproboj poszukac w podziemnych ruinach na Kongo. To miejsce dawno temu zamieszkaly medusy, hydry i inne wijace sie pomioty i do tego zaroslo paskudna flora. Idealne miejsce na oltarz dla wezowych bogow.",
	["Grazhena Core? Hmm... My mother Xena once belonged to a rural housewives club. Ask her if she knows more about this object. She is the leader of the feminists. Maybe you've already met her."] = "Grazyna Core? Hmm... Moja matka Xena nalezala kiedys do sekty gospodyn wiejskich. Zapytaj ja, czy wie cos wiecej o tym przedmiocie. Jest przywodczynia feministek. Mozliwe, ze juz ja poznales.",
	["Skurwiwij had Grazhenacore, and you lost it? Come back when you find your lost item."] = "Skurwiwij byl posiadaniu grazynacore, a Ty to zgubiles? Wroc jak znajdziesz swoja zgube.",
	["Thanks for your help. Here's your reward for completing the task: {axe}, {sword}, {mace}, {bow}, {rod}, {wand} (exercise weapon)."] = "Dzieki za pomoc. Oto twoja nagroda za wykonanie zadania: {axe}, {sword}, {mace}, {bow}, {rod}, {wand} (exercise weapon)",
	["If you have a moment, go to the summit of the highest mountain in the Caribbean. You might find someone there whom you once knew."] = "Jezeli masz chwile, to udaj sie na Szczyt najwyzszej gory na karaibach. Byc moze znajdziesz tam osobe, ktora niegdys znales.",
	["They locked me in here and blocked the exit with magical doors that I can't pass in my current state. You know what? Something is {itching} me here."] = "Zamkneli mnie tu i zablokowali wyjscie magicznymi drzwiami, ktorych nie moge przejsc w moim aktualnym stanie. Wiesz, co? Cos mnie tutaj {swedzi}.",
	["It's Rat Bum! I have Rat Bum in my pants! When I pull him out, he jumps back in. {Help} me deal with him!"] = "To zul szczurow! Zula szczurow w gaciach mam! Jak go wyciagam, to wskakuje z powrotem. {Pomoz} mi sie z nim uporac!",
	["He jumped out! You must have scared him! He jumped into that hole, which is too small for a human. There's some hole in front of my cell. Perhaps it leads to the same cave where that rascal fled!"] = "Wyskoczyl! Chyba sie ciebie przestraszyl! Wskoczyl do tej dziury, ktora jest za mala dla czlowieka. Przed moja cela jest jakas dziura. Byc moze prowadzi do tej samej jaskini, do ktorej uciekl ten skubaniec!",
	["I'll now return to the village and meet my friends from my club. Thank you for your help."] = "Wroce teraz do wioski i spotkam sie z moimi przyjaciolkami z kolka gospodyn wiejskich. Dziekuje Ci za pomoc.",
	["Cave entrance is just before the cell. Im gonna wait here."] = "Jaskinia jest tuz przed cela. Ja tu zaczekam.",
	["Good day person |PLAYERNAME|. We are here to {discuss} compensation claims related to the 'accident' in which Mr. HF-P/X was injured."] = "Dzien dobry osobo |PLAYERNAME|. Jestesmy tutaj, aby {omowic} roszczenia odszkodowawcze w zwiazku z 'wypadkiem', w ktorym ucierpial Pan HF-P/X",
	["According to our information, you {was} the main cause of the accident that resulted in Mr. HF-P/X's injuries."] = "Wedlug naszych informacji, {byl} Pan glownym sprawca wypadku, ktory narazil Pana HF-P/X na obrazenia.",
	["In that case, please send the documents, and our team of specialists shh butt butt butt kshhhh. Oh, damn, my throat recorder broke. Umm... okay, I was lying about the insurance. But understand me - ever since the emperor took my lands, I have to fight for them, which has made me even more homeless."] = "W takim razie prosze o przeslanie dokumentow, a nasz zespol specjalistow shh dupa dupa dupa dupa kshhhh. O cholera, zepsul mi sie dyktafon krtaniowy. Yyy... no dobra, sciemnialem z tym ubezpieczeniem. Ale zrozum mnie - od kiedy imperator zabral mi te ziemie, musze o nie walczyc, przez co stalem sie jeszcze bardziej bezdomny.",
	["It seems I got lost in the corridors of time. I have vague memories from the future that I am a bouncer in my hometown. I think I could help you with the immigrant influx, but first, I need to reconcile with my present self. Find my equipment stolen by bandits, and I will help you."] = "Wyglada na to, ze zgubilem sie w korytarzach czasu. Mam niejasne wspomnienia z przyszlosci, ze jestem strazniekiem w moim rodzinnym miescie. Mysle, ze bede mogl Ci pomoc z naplywem imigrantow, ale najpierw musze scalic sie z moim terazniejszym soba. Znajdz moj osprzet skradziony przez bandytow, a Ci pomoge.",
	["Thank you, that's mine. Okay, now I'm going back to the {present}!"] = "Dziekuje, to nalezy do mnie. Ok, to teraz wracam do {terazniejszosci}!",
	["Are you sure you didn't lose any of my stuff along the way?"] = "Jestes pewien, ze nie zgubiles gdzies moich rzeczy po drodze?",
	["Tell Tomek that I will deal with those refugees as soon as I can. Actually, I've already dealt with them. Yeah, the paradoxes of time travel. And one more thing: the person responsible for convincing immigrants to use the HF-P/X portal was none other than Rat Bum."] = "Przekaz Tomkowi, ze rozprawie sie z tymi uchodzcami tak szybko jak moge. A wlasciwie to juz sie z nimi rozprawilem. Mnoza sie byty paradoksu czasu. I jeszcze jedno: osoba odpowiedzialna za przekonanie imigrantow do uzycia portalu HF-P/X byl nie kto inny jak Zul Szczurow",
	["My magic doesn't seem to work. We'll need elven spells. Go to the elves' rock and get some magical powder that I can use for the ritual. Watch out for the dormant Soros foundations. I've seen that they too got lost in this world."] = "Moja magia chyba nie zadziala. Potrzeba bedzie elfickich czarow. Udaj sie na skalke elfow i pobierz troche magicznego prochu, ktorego bede mogl uzyc do rytualu. Uwazaj na uspione fundacje sorosa. Widzialem, ze oni tez zgubili sie gdzies w tym swiecie.",
	["I don't know where they moved my stuff to."] = "Nie wiem gdzie mogli schowac moje rzeczy.",
	["Come back when you have Grazhenacore with you."] = "Wroc, gdy bedziesz miec grazynacore przy sobie.",
	["The existence of cancercontent is necessary if we want to maintain the balance of the universe. The cringe factory of rural housewives' kept our world at rest until recently when Grazhena Core was stolen. I will now take Grazhenacore from you. Try to find Grazhena in the prison. Self-proclaimed heroes from the eastern part of the city have locked her in the depths of their dungeons. Now she is forced to live among nightmare creatures."] = "Istnienie rakcontentu jest konieczne, jezeli dazymy do utrzymania rownowagi wszechswiata. Fabryka cringe gospodyn wiejskich trzymala nasz swiat w stanie spoczynku az do niedawna, gdy Garzyna Core zostal wykradziony. Wezme teraz od Ciebie grazynacore. Ty sproboj znalezc grazyne w wiezieniu. Samozwanczy bohaterowie z osady na wschodzie miasta zamkneli ja w glebiach swoich lochow. Teraz jest zmuszona do zycia wsrod bestii z koszmarow.",
	["Elvish dust. Timmy might be needing this"] = "Elficki proszek magiczny. Timmy moze go potrzebowac",
	["Timmy belongings. He might be needing them"] = "Rzeczy Timmyego. Moze ich teraz potrzebowac",
	["Mysterius instrument. Most curious monsters can it allure"] = "Mistyczny instrument potrafiacy przywolac najdziwniejsze stworzenia",
	["Grazhena Core i7"] = "Grazyna Core i7",
	["As i said, go to the Karaiby."] = "Tak jak mowilem. Udaj sie na karaiby.",
}
